import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AppComponent } from './app.component';
import { LoginPageComponent } from './pages/login-page/login-page.component';
import { HomePageComponent } from './pages/home-page/home-page.component';

const routes: Routes = [
  { path: '', component: LoginPageComponent },   // Chemin par défaut (page de login)
  { path: 'homePage', component: HomePageComponent },   // Chemin par défaut (Accueil)
  { path: 'myTreePage', component: HomePageComponent },   // Chemin par défaut (Accueil)
  { path: 'contactPage', component: HomePageComponent },   // Chemin par défaut (Accueil)
  { path: 'directoryPage', component: HomePageComponent },   // Chemin par défaut (Accueil)
  { path: 'profilPage', component: HomePageComponent },   // Chemin par défaut (Accueil)

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})


export class AppRoutingModule { }
